Если вы осознанно подходите к посещению конференций и форумов, вам важны новые связи и знакомства, если вы хотите помнить всё самое важное — CampuZ создан для вас.

В приложении вы:
найдёте информацию обо всех спикерах, участниках и организаторах;
сможете задать любой вопрос лично спикеру;
построите маршрут до места проведения;
посмотрите план помещения и расположения залов и стендов;
составите своё личное расписание из интересующих выступлений;
сможете создавать заметки о выступлениях, спикерах и новых знакомствах;
первыми узнаете новости о мероприятии;
сможете записать видео лучших моментов мероприятия.

Если мероприятия, на которое вы идёте, еще нет в приложении CampuZ, скажите об этом организатору мероприятия. Он сможет связаться с нами и добавить мероприятие в приложение.
